import React from 'react';
import {withRouter } from 'react-router-dom';
import { connect } from 'react-redux';
import axios from 'axios';
import Header from '../Header/Header';
import './table.css';
//import * as contactsAction from '../../actions/contactAction';

class MyContacts extends React.Component {

    constructor(props) {
        super(props);
    }

    componentDidMount(){
        const loggingIn = localStorage.getItem('user-token');
        if(!loggingIn){
          this.props.history.push("/");
        }
        const {user_id} = 1;
        console.log('Data is fetching');
        // fetch('http://localhost:7000/api/user/fetchContact')
        // .then(contacts => {
        //     console.log('respone data',contacts);
        //   //dispatch({type:"FETCH_CONTACTS",contacts});
        // }).catch(err=>{
        //    alert('Network issue');
        // });
        axios.post('http://localhost:7000/api/user/fetchContact')
        .then(response => {
            console.log('response',response);
          //this.setState({ business: response.data });
          })
        .catch(function (error) {
          console.log(error);
        })

    }
    componentWillMount() {
       // this.props.fetchContact();
    }

    render() {
        const {contactList} = this.props;
        return (
            <>
            <Header />
                <div className="container">
        <pre>{JSON.stringify(contactList,null,2)}</pre>
                    <div className="table-wrapper">
                    <div className="table-title">
                        <div className="row">
                        <div className="col-sm-5">
                            <h2>My <b>Contacts Listing</b></h2>
                        </div>
                        </div>
                    </div>

                        <table className="table table-striped table-hover">
                            <thead>
                            <tr>
                                <th>#</th>
                                <th>Name</th>						
                                <th>Username</th>
                                <th>Contact No</th>
                                <th>Email</th>
                                <th>Date Created</th>
                                <th>Action</th>
                            </tr>
                            </thead>
                            <tbody>
                            <tr>
                                <td>1</td>
                                <td><a href="#"><img src="1.jpg" className="avatar" alt="Avatar" /> Michael Holz</a></td>
                                <td>kaleyada</td>    
                                <td>8178324115</td>                     
                                <td>kumarkaleshwar199@gmail.com</td> 
                                <td>04/10/2013</td>
                                <td>
